import styled from 'styled-components';

export const Container = styled.div`
    display: flex;
    flex-direction: column;
    background-color: #f3f3f3;
    padding: 20px;
`;

export const FormSection = styled.div`
    display: flex;
    justify-content: center;
    background-color: #c4c4c4;
    padding: 40px;
    position: relative;
    z-index: 1;
`;

export const Form = styled.div`
    width: 50%;
`;

export const Input = styled.input`
    width: 100%;
    padding: 15px;
    margin-bottom: 15px;
    border: 1px solid #ccc;
    border-radius: 5px;
    background-color: #e9e9e9;
`;

export const Textarea = styled.textarea`
    width: 100%;
    padding: 15px;
    height: 100px;
    border: 1px solid #ccc;
    border-radius: 5px;
    background-color: #e9e9e9;
    margin-bottom: 15px;
`;

export const SubmitButton = styled.button`
    background-color: #dd91b9;
    color: white;
    padding: 10px 20px;
    border: none;
    border-radius: 5px;
    cursor: pointer;
    font-size: 16px;
    width: 100%;
`;

export const RightSection = styled.div`
    position: absolute;
    right: 10%;
    top: 50%;
    transform: translateY(-50%);
    background-color: white;
    padding: 20px;
    border-radius: 5px;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    width: 250px;
    z-index: 2;
`;

export const InfoBox = styled.div`
    display: flex;
    flex-direction: column;
`;

export const InfoItem = styled.div`
    margin-bottom: 20px;
    strong {
        font-weight: bold;
    }
`;

export const PinkSection = styled.div`
    background-color: #dd91b9;
    color: white;
    padding: 40px;
    margin-top: -30px; /* Adjust as necessary */
    z-index: 0;
`;

export const GetInTouch = styled.h2`
    margin-bottom: 10px;
    font-size: 24px;
    font-weight: bold;
`;

export const SubText = styled.p`
    font-size: 16px;
    margin-bottom: 20px;
`;

export const LoremText = styled.p`
    font-size: 12px;
    margin-bottom: 40px;
`;

export const SocialIcons = styled.div`
    display: flex;
    gap: 10px;
`;

export const Icon = styled.div`
    font-size: 24px;
    cursor: pointer;
`;

const Contact = () => {
    return (
        <Container>
            <FormSection>
                <Form>
                    <Input type="text" placeholder="Enter your Name" />
                    <Input type="email" placeholder="Enter a valid email address" />
                    <Textarea placeholder="Enter your message" />
                    <SubmitButton>Submit</SubmitButton>
                </Form>
            </FormSection>
            <RightSection>
                <InfoBox>
                    <InfoItem>
                        <strong>CALL US</strong><br />
                        1 (234) 567-891<br />
                        1 (234) 987-654
                    </InfoItem>
                    <InfoItem>
                        <strong>LOCATION</strong><br />
                        121 Rock Street, 21 Avenue,<br />
                        New York, NY 92103-9000
                    </InfoItem>
                    <InfoItem>
                        <strong>BUSINESS HOURS</strong><br />
                        Mon – Fri ..... 10 am – 8 pm<br />
                        Sat, Sun ........ Closed
                    </InfoItem>
                </InfoBox>
            </RightSection>
            <PinkSection>
                <GetInTouch>GET IN TOUCH</GetInTouch>
                <SubText>
                    Hey! We are looking forward to start a project with you!
                </SubText>
                <LoremText>
                    Etiam sit amet convallis erat – class aptent taciti sociosqu ad litora torquent per conubia! Maecenas gravida lacus. Lorem etiam sit amet convallis erat.
                </LoremText>
                <SocialIcons>
                    <Icon>🔗</Icon>
                    <Icon>🔗</Icon>
                    <Icon>🔗</Icon>
                    <Icon>🔗</Icon>
                </SocialIcons>
            </PinkSection>
        </Container>
    );
};

export default Contact;
